import React from 'react';
import logo from './images/logo.svg';
import {About} from './components';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="header">
        <img src={logo} className="logo" alt="logo" />
        <About/>
      </div>
    </div>
  );
}

export default App;
